import React from "react";
import { Container, Row, Col, Card, CardHeader, CardBody } from "shards-react";
import ScriptTag from 'react-script-tag';


class Tables extends React.Component {
  componentDidMount() {
    const script = document.createElement("script");
    script.src = "http://localhost/html/main/usa_data.js";
    script.async = true;
    // script.onload = () => this.scriptLoaded();
  
    document.body.appendChild(script);
  }
  render(){
    return(
      
      <Container fluid className="main-content-container px-4">
        <Row noGutters className="page-header py-4">
        <title>USA demo</title>
        <link href="https://fonts.googleapis.com/css?family=Orbitron" rel="stylesheet"></link>
        <link href="https://fonts.googleapis.com/css?family=Unlock" rel="stylesheet"></link>
        {/* <link rel="stylesheet" type="text/css" href="http://localhost/html/main/usa_data.css"></link> */}
        <div id="title">The American way of life</div>
        <script src="https://d3js.org/d3.v5.min.js"></script>
        <script type="text/javascript" src="http://localhost/html/main/usa_data.js"></script>
        {/* <img src="http://localhost/html/main/a.png" width="500" alt="ROI Locations" /> */}
        </Row>
        </Container>
    );
  }
} 

export default Tables;
